data = data.split("\n")



def find_m(line_index, char_index):
    poss_m_dispacement = []
    for i in [-1, 0 , 1]:
        for j in [-1, 0, 1]:
            try:
                if data[i + line_index][j + char_index].upper() == "M":
                    poss_m_dispacement.append((i,j))
            except IndexError:
                pass
    
    return poss_m_dispacement

def part2(data):
    data = list(map(list, data))
    total = 0
    for line_index, line in enumerate(data):
        for char_index, character in enumerate(line):
            if character.upper() == "A":
                poss_displacements = find_m(line_index, char_index)
                cross_disps = 0
                for poss_displacement in poss_displacements:
                    try:
                        if line_index - poss_displacement[0] >= 0 and char_index - poss_displacement[1] >= 0:
                            if poss_displacement[0] * poss_displacement[1] != 0:
                                if data[line_index - poss_displacement[0]][char_index - poss_displacement[1]] == "S":
                                    cross_disps += 1
                    except IndexError:
                        pass
                if cross_disps == 2:
                    total += 1
    
    print(total)

